import { Outlet } from 'react-router-dom';
import NavigationBar from './NavigationBar';
import { UserContextProvider } from './contexts/UserContext';
import { Nav } from "react-bootstrap";
import { NavLink } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <UserContextProvider>
        <NavigationBar />
        <Outlet />
      </UserContextProvider>
    </div>
  );
}
export default App;
